		var data = JSON.parse(ensembl_json);
		var menu_pane = d3.select(div)
			.append("div")
			.append("span")
			.text("Layout:  ");
		var sel = menu_pane
			.append("select")
			.on("change", function(d) {
				switch (this.value) {
					case "unscaled":
						sT.layout().scale(false);
						break;
					case "scaled":
						sT.layout().scale(true);
						break;
				};
				sT.update();
			});
		sel
			.append("option")
			.attr("value", "unscaled")
			.attr("selected", 1)
			.text("Unscaled");
		sel
			.append("option")
			.attr("value", "scaled")
			.text("Scaled");

		// var tree = epeek.tree.tree(data);
		var gene_label = epeek.tree.label.text().text(function(d) {
			if (d.children) {
				return d.name;
			}
			if (d.sequence && d.sequence.name) {
				return d.sequence.name;
			} else {
				return "no gene name";
			}
		});
		var taxonomy_label = epeek.tree.label.text().text(function(d) {
			if (d.children) {
				return d.name;
			}
			if (d.taxonomy && d.taxonomy.scientific_name) {
				return d.taxonomy.scientific_name;
			} else {
				return "NOTHING!!";
			}
		});

		// The image label shows a picture of the species
		var image_label = epeek.tree.label.img()
			.src(function(d) {
				if (!d.children && d.taxonomy.scientific_name) {
					var changed_name = d.taxonomy.scientific_name.replace(' ', '_');
					return pics_path + "/thumb_" + changed_name + ".png";
				} else {
					var test = d;
				}
			})
			.width(function() {
				return 17;
			})
			.height(function() {
				return 17;
			});
		// The joined label shows a picture + the common name
		var joined_label = epeek.tree.label.composite()
			.add_label(image_label)
			.add_label(gene_label);
		// sT.label(label);
		// The menu to change the labels dynamically
		var menu_pane = d3.select(div)
			.append("div")
			.append("span")
			.text("Label display:   ");

		var label_type_menu = menu_pane
			.append("select")
			.on("change", function(d) {
				switch (this.value) {
					case "joint":
						sT.label(joined_label);
						break;
					case "gene":
						sT.label(gene_label);
						break;
					case "taxonomy":
						sT.label(taxonomy_label);
						break;
				}

				sT.update();
			});
		label_type_menu
			.append("option")
			.attr("value", "joint")
			.attr("selected", 1)
			.text("joint");
		label_type_menu
			.append("option")
			.attr("value", "gene")
			.text("gene");
		label_type_menu
			.append("option")
			.attr("value", "taxonomy")
			.text("taxonomy");



		sT
			.data(data.tree)
		// .duration(5000)
		.layout(epeek.tree.layout.vertical().width(500).scale(false))
			.label(joined_label)
			.link_color(function(link) {
				var col = "steelblue";
				if (link.source && link.source.events) {
					switch (link.source.events.type) {
						case "speciation":
							col = "darkgreen";
							break
						case "duplication":
							col = "darkred";
							break
					}
					return col
				}
			})
			.node_color(function(node) {
				if (node.events && node.events.type && node.events.type === 'speciation') {
					return 'green';
				} else if (node.events && node.events.type && node.events.type === 'duplication') {
					return 'red';
				} else {
					return 'orange';
				}
			});
		// .foreground_color('green')
		;
